import * as style from "../../css/light/profileList"
import getSearch from './dataRetrieval/getSearch';

export default function ProfileList(props) {
  const handleInputChange = string => {
    props.setProfileDataToRender(getSearch(string, props.listToRender, props.profileData))
  }
  
  return (
    <div style={style.container}>
      <input style={style.searchInput} onChange={e => handleInputChange(e)}/>
      <ProfileList 
        listToRender={props.listToRender} 
        profileDataToRender={props.profileDataToRender} 
        totalToRenderNumber={props.totalToRenderNumber} 
        focused={props.focused} 
        setFocused={props.setFocused}/>
      <Total totalToRenderNumber={totalToRenderNumber} setTotalToRenderNumber={setTotalToRenderNumber} profileDataToRender={profileDataToRender} listToRender={listToRender}/>
    </div>
  )
}
